1) LAUDO DE ANÁLISE Nº 1180.1P.0/2024 DO PRODUTO TEMPERO ALHO E SAL MARCA SABOR AMI, COM RESULTADO INSATISFATÓRIO PARA ANÁLISE DE ROTULAGEM E SATISFATÓRIO PARA AS DEMAIS ANÁLISES;
2) LAUDO DE ANÁLISE Nº 1181.1P.0/2024 DO PRODUTO PREPARADO SÓLIDO PARA REFRESCO DE UVA MARCA PROMIX, COM RESULTADO SATISFATÓRIO PARA AS ANÁLISES REALIZADAS.
